import React from 'react';

import './movie-list.styles.scss';


export const MovieList = props => (
    <div className="movie-list">
         {
          props.movies.map(movie => 
            <h1 key={movie.Poster}>
              {movie.Title}
            </h1> )
        }
    </div>
);
